    [],nt"num_tags": 4,nt"name": "benton-lake-refuge-shelterbelt-habitat-suitability-and-bird-use-study",nt"isopen":
    false,nt"url": null,nt"notes": "Shelterbelts were planted on Benton Lake
    NWR initially in the 1960s, but have been maintained and expanded as recently as
    the 1990s. Since that time, many of the shelterbelt trees and shrubs have died.
    Decisions will be made about whether or not shelterbelts on Benton Lake NWR should
    be removed or maintained during the CCP process; having sufficient background data
    on shelterbelt condition, quality and bird use will inform future management of
    these shelterbelts. The initial inventory of shelterbelts described here will address
    four management questions (objectives): (1) What is the current condition of shelterbelts
    on the refuge in terms of their contribution to bird species diversity (assuming
    that was the original management goal)? (2) What bird species are currently using
    shelterbelts on the refuge and their relative relative abundance? (3) How important
    are shelterbelts to species of management concern? (4) Are shelterbelts having a
    negative impact on grassland birds on Benton Lake NWR?",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
